QuestionGroup.create!([
  {id: 1, theme: "", content: "Communities and people affected by crisis receive assistance appropriate and relevant to their needs", created_at: "2016-09-12 23:14:35", updated_at: "2016-09-12 23:14:35", user_id: 3},
  {id: 2, theme: "", content: "Communities and people affected by crisis have access to the humanitarian assistance they need at the right time.", created_at: "2016-09-12 23:37:46", updated_at: "2016-09-12 23:37:46", user_id: 3},
  {id: 3, theme: "", content: "Communities and people affected by crisis are not negatively affected and are more prepared, resilient and less at-risk as a result of humanitarian action.", created_at: "2016-09-12 23:38:06", updated_at: "2016-09-12 23:38:06", user_id: 3},
  {id: 4, theme: "", content: "Communities and people affected by crisis know their rights and entitlements, have access to information and participate in decisions that affect them.", created_at: "2016-09-12 23:38:24", updated_at: "2016-09-12 23:38:24", user_id: 3},
  {id: 5, theme: "", content: "Communities and people affected by crisis have access to safe and responsive mechanisms to handle complaints.", created_at: "2016-09-12 23:38:44", updated_at: "2016-09-12 23:38:44", user_id: 3},
  {id: 6, theme: "", content: "Communities and people affected by crisis receive coordinated, complementary assistance.", created_at: "2016-09-12 23:38:59", updated_at: "2016-09-12 23:38:59", user_id: 3},
  {id: 7, theme: "", content: "Communities and people affected by crisis can expect delivery of improved assistance as organisations learn from experience and reflection.", created_at: "2016-09-12 23:39:15", updated_at: "2016-09-12 23:39:15", user_id: 3},
  {id: 8, theme: "", content: "Communities and people affected by crisis receive the assistance they require from competent and well-managed staff and volunteers.", created_at: "2016-09-12 23:39:32", updated_at: "2016-09-12 23:39:32", user_id: 3},
  {id: 9, theme: "", content: "Communities and people affected by crisis can expect that the organisations assisting them are managing resources effectively, efficiently and ethically.", created_at: "2016-09-12 23:39:49", updated_at: "2016-09-12 23:39:49", user_id: 3}
])

